import styles from "./MediaManagement.module.scss";
const MediaManagement = () => {
	const rootFolders = [{ path: "tv", freeSpace: "782.3GGB" }, {}];

	return (
		<div className={styles.mediaManagement}>
			<div className={styles.rootFolder}>
				<div className={styles.header}>Root Folder</div>
				<table className={styles.table}>
					<tr>
						<th>Path</th>
						<th>Free Space</th>
						<th>Unmapped Folders</th>
					</tr>
					{}
				</table>
				<div className={styles.button}>Choose Another Folder</div>
			</div>
		</div>
	);
};
export default MediaManagement;
